import { useState, useContext} from 'react';
import Filter from './components/filter/Filter';
import { FilterContext } from './contexts/FilterContext';
import { DashboardContext } from './contexts/DashboardContext';
import Axios from 'axios';

function App() {
	const { start, end, store, selectedStore } = useContext(FilterContext);
	const [startDate, setStartDate] = start;
	const [endDate, setEndDate] = end;
	const [defaultStore, setDefaultStore] = store;
	const [newSelectedStore, setNewSelectedStore] = selectedStore;
	console.log(startDate);
	console.log(endDate);
	console.log(defaultStore);
	console.log(newSelectedStore);

	const { data } = useContext(DashboardContext);
	const [newData, setNewData] = data;

	console.log(newData);
	const getAPI = () => {
		Axios.get('https://randomuser.me/api/').then(
			(response) => {
				console.log(response);
				return response;
			}
		);
	};
	const testAPI = () => {
		const response = Axios('https://randomuser.me/api/');
		console.log(response);
	};

	function test() {
		let a = testAPI();
		console.log(a);
	};

	function fetchAPI(param, callback) {
		return fetch('https://randomuser.me/api/').then(callback);
	}
	console.log(fetchAPI);
	function callAPI(){
		fetchAPI(result =>
			setNewData({ result }));
	};	

	return (
		<div className="App">
			<Filter />
			<button onClick={ test }>Filter</button>
			<p> Default(URL) Store: {defaultStore}</p>
			<p> Selected Store: {newSelectedStore}</p>
		</div>
	  );
}

export default App;
